import React, { useState, useEffect } from 'react';
import L, { icon } from 'leaflet';
import 'leaflet-routing-machine/dist/leaflet-routing-machine.css';
import 'leaflet-routing-machine';

const markerIcon = "data:image/png;base64,";

const markerIcon2 = "data:image/png;base64,";

const Map = (props) => {
    const [places, setPlaces] = useState(undefined);
    const [days, setDays] = useState(undefined);
    const [flag, setFlag] = useState(undefined)

    useEffect(() => {
        setPlaces(props.data);
        setDays(props.days);
        setFlag(()=>{return props.flag})
    }, [props.data, props.days, props.flag]);

    useEffect(() => {
        if (!places || places.length === 0) return;

        const map = L.map('map').setView([places[0]?.latitude, places[0]?.longitude], 13);

        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        }).addTo(map);

        places.forEach(place => {
            let iconUrl;
            if (flag === 12){
                iconUrl = place.day <= days ? markerIcon2 : markerIcon;
            }else{
                iconUrl = place.day <= days ? markerIcon : markerIcon2;
            }
            const customIcon = L.icon({
                iconUrl: iconUrl,
                iconSize: [25, 41],
                iconAnchor: [12, 41],
                popupAnchor: [0, -35]
            });

            L.marker([place.latitude, place.longitude], { icon: customIcon })
                .addTo(map)
                .bindPopup(place.name);
        });

        return () => {
            map.remove();
        };
    }, [places, days]);

    return (
        <div className="container mt-4">
            <div className="card">
                <div className="card-body">
                    <div className='container mt-2 mb-2 d-flex justify-content-between'>
                        <h5 className="card-title fw-bold">Map</h5>
                        <div className="marker-wrapper">
                            <div className="marker">
                                <img src={markerIcon2} alt="" style={{ width: '20px' }} />
                                <span className="marker-text">Selected place</span>
                            </div>
                            <div className="marker">
                                <img src={markerIcon} alt="" style={{ width: '20px' }} />
                                <span className="marker-text">Suggested place</span>
                            </div>
                        </div>
                    </div>
                    <div id="map" style={{ height: '75vh', border: '1px solid #ccc', borderRadius: '5px' }} />
                </div>
            </div>
        </div>
    );
};

export default Map;
